(9, 'Bélgica', '60513c0c8ad72.jpg', 'Desde $ 2,225,272.00 MN', '<p>Desde 50m2 hasta 69.63m2</p>', 'CDMX', 'Benito Juárez, Ciudad de México', '<p>B&eacute;lgica se encuentra en Portales Benito Ju&aacute;rez cuenta con excelentes v&iacute;as de acceso y una ubicaci&oacute;n privilegiada.</p>\n<p>Desarrollo B&eacute;lgica.</p>\n<p>Direcci&oacute;n:</p>\n<p>B&eacute;lgica 1109, Colonia Portales Sur, C.P 03300.</p>\n<p>Este desarrollo es de entrega Inmediata.</p>', '<p>B&eacute;lgica cuenta con Roof Garden perfecto para pasar grandes momentos en el.</p>\n<p>&nbsp;</p>\n<p>Te presentamos los tama&ntilde;os y precios de cada uno de los dise&ntilde;os de estos departamentos.</p>\n<p>&nbsp;</p>\n<p>M2 totales: 69.63</p>\n<p>Recamaras: 2</p>\n<p>Ba&ntilde;os: 1</p>\n<p>Precio: $ 2,856,000.00 MN</p>\n<p>Fecha de entrega: inmediata</p>\n<p>&nbsp;</p>\n<p>M2 totales: 50</p>\n<p>Recamaras: 1</p>\n<p>Ba&ntilde;os: 1</p>\n<p>Precio: $ 2,225,272.00 MN</p>\n<p>Fecha de entrega: inmediata</p>\n<p>&nbsp;</p>\n<p>&Aacute;reas Comunes:</p>\n<p>-Muros con enlucido de yeso acabados con pintura vin&iacute;lica blanca</p>\n<p>-Techos con enlucido de yeso acabados con pintura vin&iacute;lica blanca</p>\n<p>-Pisos acabados en loseta cer&aacute;mica</p>\n<p>-Iluminaci&oacute;n a base de luminarias de bajo consumo seg&uacute;n proyecto en plaf&oacute;n o muro</p>\n<p>-Canceler&iacute;a en aluminio con cristal claro o esmerilado</p>\n<p>-Timbre con sistema de agua de acuerdo a las normas vigentes</p>\n<p>-Cisterna de 10,000 litros alojada en las celdas de cimentaci&oacute;n del edificio</p>\n<p>-Gas L.P seg&uacute;n proyecto normativas vigentes</p>\n<p>&nbsp;</p>\n<p>Departamentos:</p>\n<p>-Muros con enlucido de yeso en muros colindantes, acabados con pintura vin&iacute;lica blanca, en &aacute;reas h&uacute;medas recubierto de loseta tipo porcelanato y muros con enlucido d yeso con pintura antihumedad</p>\n<p>-Techos con yeso acabados con pintura vin&iacute;lica blanca</p>\n<p>-Pisos acabados con loseta de cer&aacute;mica en ba&ntilde;os, cocinas, habitaciones, sala y comedor. Los zoclos ser&aacute;n de acuerdo con el material, el piso ser&aacute; de color de acuerdo con el render</p>\n<p>-Iluminaci&oacute;n a base de luminarias de bajo consumo, seg&uacute;n proyecto en techo</p>\n<p>-Accesorios el&eacute;ctricos modelo Matix, de Bticino, o similar</p>\n<p>-Canceler&iacute;a en aluminio seg&uacute;n proyecto con cristal de 6 mil&iacute;metros claro o esmerilado, cancel de ba&ntilde;o terminado de cristal templado de 6 mil&iacute;metros seg&uacute;n proyecto</p>\n<p>-Cocina integral contara con estufa, horno, gabinetes, campa&ntilde;a y tarja de acero inoxidable con monomando.</p>\n<p>-Ba&ntilde;os los muebles de ba&ntilde;o ser&aacute;n de porcelana color blanco. Se contar&aacute; con inodoro, lavabo con mueble de madera o similar con monomando y regadera con monomando. Los accesorios son una papelera y un toallero</p>\n<p>-Carpinter&iacute;a puertas de tambor de caobilla con cerraduras, closet de melanina terminado en recamara con herrajes acabado seg&uacute;n dise&ntilde;o</p>\n<p>-Centro de lavado los muros interiores van con aplanado fino y pintura esmalte blanco con piso y zoclo de loseta cer&aacute;mica</p>\n<p>-Calentador instant&aacute;neo para un servicio.</p>', '', '', '', 'https://goo.gl/maps/8dVMT2CnNmMsAT5i7', 2, 7, '2225272'),
(8, 'Asturias', '6050f7f8e4240.jpg', 'Desde $ 1,815,000.00 MN', '<p>Desde 49m2 hasta 82.46m2</p>', 'CDMX', 'Cuauhtémoc, Ciudad de México', '<p>Asturias es un lugar tranquilo para vivir, se encuentra ubicado en Viaducto Rio De La piedad 260-B, Colonia Asturias en la Alcald&iacute;a Cuauht&eacute;moc, C.P 06850.</p>\n<p>Cuenta con excelente ubicaci&oacute;n.</p>\n<p>Este desarrollo es de entrega inmediata.</p>', '<p>Te presentamos los tama&ntilde;os de cada uno de nuestros departamentos en Asturias, este desarrollo cuenta con Roof Garden y balcones.</p>\n<p>&nbsp;</p>\n<p>M2 totales: 49&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n<p>Recamaras: 1</p>\n<p>Ba&ntilde;os: 1</p>\n<p>Precio: $ 1,815,000.00 MN</p>\n<p>Fecha de entrega: inmediata</p>\n<p>Estatus: VENDIDO</p>\n<p>&nbsp;</p>\n<p>M2 totales: 82.46&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n<p>Recamaras: 2</p>\n<p>Ba&ntilde;os: 1</p>\n<p>Precio: $ 2,770,885.00 MN</p>\n<p>Fecha de entrega: inmediata</p>\n<p>Estatus: VENDIDO</p>\n<p>&nbsp;</p>\n<p>M2 totales: 71.27&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n<p>Recamaras: 2</p>\n<p>Ba&ntilde;os: 1</p>\n<p>Precio: $ 2,387,545.00MN</p>\n<p>Fecha de entrega: inmediata</p>\n<p>Estatus: disponible</p>\n<p>&nbsp;</p>\n<p>M2 totales: 78.88&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\n<p>Recamaras: 2</p>\n<p>Ba&ntilde;os: 1</p>\n<p>Precio: $ 2,810,270.00 MN</p>\n<p>Fecha de entrega: inmediata</p>\n<p>Estatus: VENDIDO</p>', '', '', '', 'https://goo.gl/maps/Kugt3rWyQFpfEECZA', 4, 3, '1815000'),
(7, 'Melchor Ocampo 324', '6175770ca4da6.jpg', 'Desde $ 2,835,000 MN', '<p>Desde 52m2 hasta 96.01m2</p>', 'CDMX', 'Cuauhtémoc, Ciudad de México', '<p>De $ 2,835,000 MN a $ 6,200,000 MN</p>\n<p>Disfruta de un lugar seguro</p>\n<p>Desde 52m2 hasta 96.01m2</p>\n<p>Este desarrollo cuenta con excelentes precios de Preventa se entrega en octubre.</p>', '<p>Melchor Ocampo es un proyecto con una ubicaci&oacute;n privilegiada, cerca de varias de las vialidades m&aacute;s importantes de la ciudad de M&eacute;xico las cuales puedes tener acceso caminando, se encuentra a 4 cuadras del &Aacute;ngel de la Independencia y la Diana Cazadora&nbsp;</p>\n<p>Estos departamentos cuentan con elevador, roff garden y tienen unas ventanas perfectamente dise&ntilde;adas para que no entre el ruido&nbsp;</p>\n<p>Departamentos desde 40m2 hasta 90m2</p>\n<p>1 y 2 recamaras, ba&ntilde;o, cocina, balc&oacute;n, roff garden y elevador&nbsp;</p>\n<p>Precios desde $2,835,000.00 hasta $6,200,000.00 conoce las facilidades de pago, nosotros te damos el cr&eacute;dito contamos con flexibilidad de pagos sin necesidad de bancos he intermediarios PREGUNTA A NUESTROS ASESORES MAS DETALLES</p>\n<p>Este desarrollo cuenta con excelentes precios entrega inmediata.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\n<p>&nbsp;</p>\n<p>DEPARTAMENTO PB 01</p>\n<p>M2 totales: 90&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;