INSERT INTO `propiedades` (`id`, `nombre_propiedad`, `imagen_portada`, `precio`, `descripcion_intro`, `estado`, `ubicacion`, `informacion`, `informacion_secundaria`, `url_pdf`, `url_video`, `url_360`, `url_maps`, `tipo`, `prioridad`, `precio_filtro`) VALUES
(11, 'Departamento Lomas de Chapultepec', '606ded9f1b396.jpg', '$ 17,900,000 MN', '<p>3 rec&aacute;maras&nbsp; |&nbsp; 4.5 ba&ntilde;os&nbsp; |&nbsp; 332 m2</p>', 'CDMX', 'Miguel Hidalgo, Ciudad de México', '<p>Lomas de Chapultepec Propiedad en Venta.</p>\n<p>Precioso departamento en Lomas de Chapultepec, es una colonia residencial y comercial en el Poniente de La Ciudad de M&eacute;xico, se encuentra en Sierra Chalchihui en las Lomas de Chapultepec, Miguel Hidalgo, C.P. 11000.</p>', '<p>Tiene 3 habitaciones, sala, comedor, sala de TV, vest&iacute;bulo, 4/1/2 ba&ntilde;os, 1 cuarto de lavado, 2 cuartos de servicio, elevador directo al departamento, elevador de servicio, cuarto de juegos para ni&ntilde;os/adultos, sal&oacute;n de fiestas, squash, alberca, bodega, seguridad 24 hrs.</p>\n<p>&nbsp;</p>\n<p>Mts Total: 332m2</p>\n<p>Rec&aacute;maras: 3</p>\n<p>Terraza: S&iacute;</p>\n<p>Ba&ntilde;os: 4 1/2</p>\n<p>Estudio y Sala de Tv: S&iacute;</p>\n<p>Cajones de estacionamiento: 4</p>\n<p>Precio: $ 17,900,000 MN</p>', '', '', '', 'https://goo.gl/maps/UfaJfw7P8ytmWHBf7', 2, 2, '17900000'),
(9, 'Departamento La Cite', '603feeea4ad14.JPG', '$ 3,500,000 MN', '<p>2 rec&aacute;maras&nbsp; |&nbsp; 2 ba&ntilde;os&nbsp; |&nbsp; 90 m2</p>', 'CDMX', 'Cuajimalpa, Ciudad de México', '<p>La Cite Propiedad en Venta</p>\n<p>Se encuentra ubicado en Carretera M&eacute;xico-Toluca 5095, La Rosita, El Yaqui, Cuajimalpa de Morelos, CDMX.</p>\n<p>Esta en un piso 9, con 2 rec&aacute;maras, 2 ba&ntilde;os completos, sala/comedor, cocina integral, cuarto de lavado con secadora integrada, 2 cajones de estacionamiento.</p>', '<p>Departamento La Cite</p>\n<p>Nivel: 9</p>\n<p>Mts total: 90m2</p>\n<p>Rec&aacute;maras: 2&nbsp;</p>\n<p>Ba&ntilde;os: 2</p>\n<p>Estudio y Sala de Tv</p>\n<p>Cajon de estacionamiento: 2</p>\n<p>Precio&nbsp; $ 3,250,000.00 MN</p>', '', '', '', 'https://goo.gl/maps/nwkKSHwb8suecnUR7', 4, 10, '3500000'),
(10, 'Casa Sumiya ', '603ff14dbcf0c.jpg', '$ 30,000,000 MN', '<p>4 rec&aacute;maras&nbsp; |&nbsp; 6 ba&ntilde;os&nbsp; |&nbsp; 1,500 m2</p>', 'Morelos', 'Cuernavaca, Morelos', '<p>Propiedad en Venta</p>\n<p>Sumiya se encuentra ubicado Residencial Sumiya 14, Cuernavaca, Morelos, C.P. 62556.</p>\n<p>3 cuartos de servicio, 6 ba&ntilde;os completos, 6 cajones de estacionamiento, cuarto de televisi&oacute;n, cocina, antecomedor, sala, alberca con cascada y jacuzzi.</p>', '<p>Casa Residencial Sumiya&nbsp;</p>\n<p>Mts Total: 1,500m2</p>\n<p>Rec&aacute;maras: 4</p>\n<p>Terraza: S&iacute;</p>\n<p>Ba&ntilde;os: 6</p>\n<p>Estudio y sala de TV: S&iacute;</p>\n<p>Lugares de estacionamiento: 6</p>\n<p>Precio: $ 30,000,000.00 MN</p>', '', '', '', 'https://goo.gl/maps/dnkK9zBL6h3HvMkaA', 4, 7, '30000000'),
(8, 'Departamento El Yaqui', '617587a9a64e0.jpg', '$ 60,000 MN', '<p>3 rec&aacute;maras&nbsp; |&nbsp; 3 ba&ntilde;os&nbsp; |&nbsp; 380 m2</p>', 'CDMX', 'Cuajimalpa, Ciudad de México', '<p>El Yaqui Propiedad en Renta</p>\n<p>Se encuentra ubicado en Carlos Echanove 5452 PH 802, Col. El Yaqui, Cuajimalpa de Morelos, CDMX.&nbsp;</p>\n<p>Cuenta con 3 recamaras con ba&ntilde;o y vestidor, sala, comedor, cocina integral, patio de servicio, cuarto de Servicio, 3 cajones de estacionamiento y bodega.</p>', '<p>Departamento:</p>\n<p>Mts Total: 380m2</p>\n<p>Rec&aacute;maras: 3</p>\n<p>Ba&ntilde;os: 3</p>\n<p>Cajones de estacionamiento: 3</p>\n<p>Precio: $ 60,000.00 MN mnesuales.</p>', '', '', '', 'https://goo.gl/maps/DHsTr1XvcwgndxJw6', 3, 3, '60000'),
(12, 'Departamento La Enramada', '6041b31588636.jpg', '$ 14,600,000 MN', '<p>3 rec&aacute;maras&nbsp; |&nbsp; 4.5 ba&ntilde;os&nbsp; |&nbsp; 332 m2</p>', 'Estado de México', 'Huixquilucan, Estado de Mexico', '<p>La Enramada Propiedad en Venta.&nbsp;</p>\n<p>Se encuentra ubicada en La Enramada en Lomas Country Club, Av. Porton de las Flores, Lomas Country Club, 52779, Huixquilucan, Edo de Mexico.</p>\n<p>El departamento se encuentra en primer nivel con terraza, 3 rec&aacute;maras con vestidor y ba&ntilde;o, comedor, sala de tv, cuarto de lavado, cuarto de servicio con ba&ntilde;o completo y bodega.</p>', '<p>Departamento: Nivel 1</p>\n<p>Mts Total: 356m2</p>\n<p>Rec&aacute;maras: 3</p>\n<p>Terraza: S&iacute;</p>\n<p>Ba&ntilde;os: 3</p>\n<p>Estudio y Sala de Tv: S&iacute;</p>\n<p>Cajones de estacionamiento: 3</p>\n<p>Precio: $ 14,600,000.00 MN</p>\n<p>Depto 1 nivel&nbsp;</p>', '', '', '', 'https://goo.gl/maps/6arCRE7p2hm94jfAA', 4, 1, '14600000'),
(13, 'Departamento Torre Infiniti', '6041b4dd09825.jpg', '$ 9,000,000 MN', '<p>2 rec&aacute;maras&nbsp; |&nbsp; 2 ba&ntilde;os&nbsp; |&nbsp; 144 m2</p>', 'CDMX', 'Cuajimalpa, Ciudad de México', '<p>Torre Infiniti Propiedad en Venta.</p>\n<p>Se encuentra ubicado prolongaci&oacute;n Paseo de la Reforma 215, Santa Fe, Paseo de las Lomas, Cuajimalpa de Morelos, 01330, Ciudad de M&eacute;xico, CDMX.</p>\n<p>Torre 3 Infiniti, piso 5 vista a Santa Fe, con 2 rec&aacute;maras, rec&aacute;mara 1 con vestidor y la 2da con closet y ba&ntilde;o completo en ambas, cuarto de lavado, cocina equipada, cuarto de servicio.</p>', '<p>Desarrollo: TORRE INFINITI&nbsp;</p>\n<p>Departamento: Depto 5 nivel Torre 3&nbsp;</p>\n<p>Mts Total: 144m2</p>\n<p>Rec&aacute;maras: 2</p>\n<p>Terraza: No</p>\n<p>Ba&ntilde;os: 2</p>\n<p>Estudio y Sala de Tv: No</p>\n<p>Cajones de estacionamiento: 2</p>\n<p>Precio: $ 9,000,000.00 MN&nbsp;</p>\n<p>Con opci&oacute;n a renta: $ 31,500 MN mensuales</p>', '', '', '', 'https://goo.gl/maps/GB5oB9EfXRHLkVqW9', 5, 5, '9000000'),
(14, 'Departamento Scala Santa Fe', '6047fde26f6c7.jpg', '$ 10,200,000 MN', '<p>3 rec&aacute;maras&nbsp; |&nbsp; 3 ba&ntilde;os&nbsp; |&nbsp; 147 m2</p>', 'CDMX', 'Cuajimalpa, Ciudad de México', '<p>Scala Santa Fe se encuentra ubicado en Vasco de Quiroga, Contadero, Cuajimalpa de Morelos, CDMX.</p>\n<p>Tiene 3 rec&aacute;maras la principal con vestidor, 3 ba&ntilde;os completos, sala, comedor, bodega, 3 cajones de estacionamiento, amenidades, &aacute;reas verdes, alberca, gym, y salones de juego.</p>', '<p>Departamento Scala Santa Fe</p>\n<p>Mts Total: 147m2</p>\n<p>Rec&aacute;maras: 3</p>\n<p>Terraza: No</p>\n<p>Ba&ntilde;os: 3</p>\n<p>Estudio y Sala de Tv: No</p>\n<p>Cajones de estacionamiento: 3</p>\n<p>Precio: $ 10,200,000.00 MN&nbsp;</p>', '', '', '', 'https://goo.gl/maps/aJfb8QvdCYEWuhFNA', 4, 6, '10200000'),
(15, 'Departamento Manuel Carpio', '617583e295406.jpg', '$ 26,000,000 MN', '<p>3 rec&aacute;maras&nbsp; |&nbsp; 3 ba&ntilde;os&nbsp; |&nbsp; 120 m2</p>', 'CDMX', 'Cuauhtémoc, Ciudad de México', '<p>Departamento ubicado en Manuel Carpio, Colonia Santa Mar&iacute;a La Ribera, Cuauht&eacute;moc.</p>\n<p>Este hermoso departamento cuenta con vista directa al parque y al museo de geolog&iacute;a, r&aacute;pido acceso a salidas como Reforma.</p>\n<p>Tiene 3 rec&aacute;maras, 3 ba&ntilde;os completos, sala /comedor, cocina, estudio de TV, 2 cajones de estacionamiento, terraza, elevador.</p>', '<p>Departamento Manuel Carpio</p>\n<p>Nivel: 3</p>\n<p>Mts Total: 120m2</p>\n<p>Rec&aacute;maras: 3</p>\n<p>Terraza: S&iacute;</p>\n<p>Ba&ntilde;os: 3</p>\n<p>Estudio y Sala de Tv: S&iacute;</p>\n<p>Cajones de estacionamiento: 2</p>\n<p>Precio: $ 26,000,000.00 MN&nbsp;</p>', '', '', '', 'https://goo.gl/maps/VKMyX1G2CNgTnCpP6', 5, 4, '26000000'),
(16, 'Departamentos Ramón López Velarde', '6048011988438.jpg', 'Desde $ 6,774,000.00 MN', '<p>2 rec&aacute;maras&nbsp; |&nbsp; 2 ba&ntilde;os&nbsp; |&nbsp; 156.47 m2</p>', 'CDMX', 'Cuauhtémoc, Ciudad de México', '<p>Ubicados en calle Ram&oacute;n L&oacute;pez Velarde, Col. Santa Mar&iacute;a la Ribera, Alcald&iacute;a Cuauht&eacute;moc.</p>\n<p>Este desarrollo de departamentos ofrece gran diversidad en &aacute;reas con gran valor arquitect&oacute;nico y cultural, localizado en un punto clave de inter&eacute;s y nuevos espacios laborales.&nbsp;</p>\n<p>Tiene todas las comodidades en transporte, vialidades, centros culturales y comerciales.</p>', '<p>Ambos departamentos cuentan con 2 habitaciones, sala, comedor, cocina con ventanas abatibles a terraza, cocina integral, cuarto de lavado, terraza, 1 caj&oacute;n de estacionamiento, cuarto de seguridad.</p>\n<p>&nbsp;</p>\n<p>Departamentos Ram&oacute;n L&oacute;pez Velarde</p>\n<p>&nbsp;</p>\n<p>Nivel: 2</p>\n<p>Mts Total: 156.47m2</p>\n<p>Rec&aacute;maras: 2</p>\n<p>Terraza: S&iacute;</p>\n<p>Ba&ntilde;os: 2</p>\n<p>Estudio y Sala de Tv: No</p>\n<p>Cajones de estacionamiento: 1</p>\n<p>Precio: $ 6,684,000.00 MN&nbsp;</p>\n<p>&nbsp;</p>\n<p>Nivel: 3</p>\n<p>Mts Total: 158.50m2</p>\n<p>Rec&aacute;maras: 2</p>\n<p>Terraza: S&iacute;</p>\n<p>Ba&ntilde;os: 2</p>\n<p>Estudio y Sala de Tv: No</p>\n<p>Cajones de estacionamiento: 1</p>\n<p>Precio: $ 6,774,000.00 MN&nbsp;</p>', '', '', '', 'https://goo.gl/maps/pxUKFD4xCNMuTP8B7', 0, 8, '6774000'),
(17, 'Vista del Campo', '6175874f301a1.jpg', '$ 55,000 MN', '<p>3 rec&aacute;maras&nbsp; |&nbsp; 3.5 ba&ntilde;os&nbsp; |&nbsp; 302 m2</p>', 'CDMX', 'Cuajimalpa, Ciudad de México', '<p>Se encuentra ubicado en Altavista 61 y 52, Lomas de Santa Fe, Prados de la Monta&ntilde;a, Cuajimalpa de Morelos C.P 05619.</p>\n<p>Este departamento tiene 302m2 de terreno, sala, comedor, 3 rec&aacute;maras con ba&ntilde;o y vestidor, medio ba&ntilde;o de visitas, sal&oacute;n de fiestas, sala de tv, alberca, gym, cocina y jard&iacute;n.</p>', '<p>Renta: $ 55,000 MN mensuales.</p>', '', '', '', 'https://goo.gl/maps/AuyU4rS7BUxuHCTS6', 3, 9, '55000'),
